import React from "react";

export default class Navbar extends React.Component{
    state = {
        data: []
    };
    getData=()=>{
        fetch("https://6278b7bcd00bded55add177e.mockapi.io/api/taskdin/navbar")
        .then(res=>res.json())
        .then(data=>{
            this.setState({ data: data })       
        })
    }
    componentDidMount(){
        this.getData();
    }
    render(){
        return(
            <aside className="navbar">
                <ul>
                {data.map(hit =>
                    <li key={hit.id}>
                        <i className="{hit.icon}"></i>{hit.name}
                        </li>
                )}
                    <li><i className="bi bi-journal-text"></i>CATALOG</li>
                    <li><i className="bi bi-graph-up"></i>PROGRESS</li>
                    <li><i className="bi bi-people"></i>JOIN GROUP</li>
                    <li><i className="bi bi-chat-right-quote"></i>DISCUSSIONS</li>
                    <li><i className="bi bi-calendar3"></i>CALENDAR</li>
                </ul>
            </aside>
        )
    }
}
